void displayConfig(){
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
    *(pixel_ctrl_ptr + 1) = 0xC8000000; // store address in back buffer
    wait_for_vsync();
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen();
    *(pixel_ctrl_ptr + 1) = 0xC0000000;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); //draw on back buffer
}

void resetDisplay(){
    wait_for_vsync(); // swap front and back buffers on VGA vertical sync
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
}

void wait_for_vsync()
{
    volatile int * pixel_ctrl_ptr=0xFF203020;
    register int status;
    
    *pixel_ctrl_ptr=1;
    
    status= *(pixel_ctrl_ptr+3);
    while ((status&0x01)!=0){
        status=*(pixel_ctrl_ptr+3);
    }

}


void plot_pixel(int x, int y,short int color){
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = color;
}

void clear_screen(){
    int maxCol=320;
    int maxRow=240;
    for (int x = 0; x < maxCol; ++x)
    {
        for (int y = 0; y < maxRow; ++y)
        {
            plot_pixel(x, y, 0xffff);
        }
    }
}

void clear_ryu(int xPos, int yPos){
    for(int y = 0; y < 85; y++){
        for(int x = 0; x < 92; x++){
            plot_pixel(y + yPos, x + xPos, 0xffff);
        }
    }
}

void clear_akuma(int xPos, int yPos){
    for(int y = 0; y < 62; y++){
        for(int x = 0; x < 102; x++){
            plot_pixel(y + yPos, x + xPos, 0xffff);
        }
    }
}


void swap(int *xp, int *yp)
{
    int temp = *xp;
    *xp = *yp;
    *yp = temp;
}

void drawMenu(){
    //we have to invert row with col to draw correctly
    for (int col=0;col<240;col++){
        for (int row=0;row<320;row++){
            plot_pixel(row,col,mainmenu[col][row]);
        }
    }
}

